import styled from 'styled-components';

export const Modules = styled.div`
display:flex;
justify-content:space-around;
`;

export const Module = styled.div`
display:flex;
flex-direction: column;
align-items: center;
`;

export const Moduleh1 = styled.h1`
font-size: 22px;
font-weight: 900;
`;
